        App3InputLabel             matlab.ui.control.Label
        App3IImage                 matlab.ui.control.Image
        App3SelectMode             matlab.ui.container.ButtonGroup
        App3ColorButton            matlab.ui.control.ToggleButton
        App3GrayscaleButton        matlab.ui.control.ToggleButton
        App3LoadFileButton         matlab.ui.control.Button
        App3FileName               matlab.ui.control.Label
        App3OPane                  matlab.ui.container.Panel
        App3OutputLabel            matlab.ui.control.Label
        App3OImage                 matlab.ui.control.Image
        App3SaveFileButton         matlab.ui.control.Button
        HistogramSpecificationTab  matlab.ui.container.Tab
        Grid4                      matlab.ui.container.GridLayout
        App4GridL                  matlab.ui.container.GridLayout
        App4IPane                  matlab.ui.container.Panel
        App4InputLabel             matlab.ui.control.Label
        App4IImage                 matlab.ui.control.Image
        App4InputLabelRef          matlab.ui.control.Label
        App4IImageRef              matlab.ui.control.Image
        App4SelectMode             matlab.ui.container.ButtonGroup
        App4ColorButton            matlab.ui.control.ToggleButton
        App4GrayscaleButton        matlab.ui.control.ToggleButton
        App4LoadFileButton         matlab.ui.control.Button
