        App4LoadFileButtonRef      matlab.ui.control.Button
        App4FileNameRef            matlab.ui.control.Label
        App4OPane                  matlab.ui.container.Panel
        App4OutputLabel            matlab.ui.control.Label
        App4OImage                 matlab.ui.control.Image
        App4SaveFileButton         matlab.ui.control.Button
        App4GridR                  matlab.ui.container.GridLayout
        App4OutputHist             histogram
        App4InputHist              histogram
    end

    
    properties (Access = private)
        I = truecolorload('images\1strawberry.png');
        filename = "No File Selected"
        a2 = 0;
        b2 = 100;

        O = truecolorload('images\1strawberry.png');
        R = truecolorload('images\1strawberry.png');
        ref_filename = "No File Selected"
    end

    methods (Static)
    
        function result = rgbtogray(I)
            result = rgb2gray(I);
            result(:,:,2) = result(:,:,1);
            result(:,:,3) = result(:,:,1);
        end
        
    end
    
    methods (Access = private)
        
        function loadImage(app)
            % Load to I
            [file, path] = uigetfile('*');
            if file == 0
                return
            end
            filepath = fullfile(path, file);
            disp(filepath);
            app.filename = filepath;
            app.I = truecolorload(filepath);

            % Update image outputs
            app.updateBasedOnTab();
        end

        function saveImage(app)
            % Get file name
            [file, path] = uiputfile({ ...
                '*.bmp', 'BMP files (*.bmp)'; ...
                '*.gif', 'GIF files (*.gif)'; ...
                '*.jpg', 'JPEG files (*jpg)'; ...
                '*.png', 'PNG files (*.png)'; ...
                '*.tif', 'TIFF files (*tif)' ...
            });
            if file == 0
                return
            end
            filepath = fullfile(path, file);
            disp(filepath);

            imwrite(app.O, filepath);
        end
        
        function loadRefImage(app)
            % Load to R
            [file, path] = uigetfile('*');
            if file == 0
                return
            end
            filepath = fullfile(path, file);
            disp(filepath);
            app.ref_filename = filepath;
            app.R = truecolorload(filepath);

            % Update only if tab 4 is selected
            selectedTab = app.TabGroup.SelectedTab;
            if selectedTab == app.HistogramSpecificationTab
                app.updateApp4Values();
            end
        end

        function updateApp1Values(app)
            selectedButton = app.App1SelectMode.SelectedObject;
            if selectedButton.Text == "Grayscale"
                app.App1Image.ImageSource = app.rgbtogray(app.I);
                app.App1Hist.HistType = HistogramType.Grayscale;

                % Run function
                hist = histogramz(rgb2gray(app.I));
                app.App1Hist.Values1 = hist;
            else % selectedButton.Text == "Color"
                app.App1Image.ImageSource = app.I;
                app.App1Hist.HistType = HistogramType.Color;

                % Run function
                app.App1Hist.Values1 = histogramz(app.I(:,:,1));
                app.App1Hist.Values2 = histogramz(app.I(:,:,2));
                app.App1Hist.Values3 = histogramz(app.I(:,:,3));
            end
            app.App1Hist.refresh();
            app.App1FileName.Text = app.filename;
        end

        function updateApp2Values(app)
            selectedButton = app.App2SelectMode.SelectedObject;
            if selectedButton.Text == "Grayscale"
                app.App2IImage.ImageSource = app.rgbtogray(app.I);
                app.App2InputHist.HistType = HistogramType.Grayscale;
                app.App2OutputHist.HistType = HistogramType.Grayscale;

                % Run function
                a = app.a2 / 100;
                b = app.b2 / 100;
                app.O = contrastStretching(rgb2gray(app.I), a, b);
                app.O = cast(app.O, 'uint8');

                % Calc Hist
                hist = histogramz(rgb2gray(app.I));
                app.App2InputHist.Values1 = hist;
                hist = histogramz(app.O);
                app.App2OutputHist.Values1 = hist;

                % Display Image
                app.O(:,:,2) = app.O(:,:,1);
                app.O(:,:,3) = app.O(:,:,1);
                app.App2OImage.ImageSource = app.O;
            else % selectedButton.Text == "Color"
                app.App2IImage.ImageSource = app.I;
                app.App2InputHist.HistType = HistogramType.Color;
                app.App2OutputHist.HistType = HistogramType.Color;

                % Run function
                a = app.a2 / 100;
                b = app.b2 / 100;
                app.O = contrastStretching(app.I(:,:,1), a, b);
                app.O(:,:,2) = contrastStretching(app.I(:,:,2), a, b);
                app.O(:,:,3) = contrastStretching(app.I(:,:,3), a, b);
                app.O = cast(app.O, 'uint8');

                % Calc Hist
                app.App2InputHist.Values1 = histogramz(app.I(:,:,1));
                app.App2InputHist.Values2 = histogramz(app.I(:,:,2));
                app.App2InputHist.Values3 = histogramz(app.I(:,:,3));
                app.App2OutputHist.Values1 = histogramz(app.O(:,:,1));
                app.App2OutputHist.Values2 = histogramz(app.O(:,:,2));
                app.App2OutputHist.Values3 = histogramz(app.O(:,:,3));

                % Display Image
                app.App2OImage.ImageSource = app.O;
            end
            app.App2InputHist.refresh();
            app.App2OutputHist.refresh();
            app.App2FileName.Text = app.filename;
        end

        function updateApp3Values(app)
            selectedButton = app.App3SelectMode.SelectedObject;
            if selectedButton.Text == "Grayscale"
                app.App3IImage.ImageSource = app.rgbtogray(app.I);
                app.App3InputHist.HistType = HistogramType.Grayscale;
                app.App3OutputHist.HistType = HistogramType.Grayscale;

                % Run function
                app.O = histogramEqualization(app.I);
                app.O = cast(app.O, 'uint8');

                % Calc Hist
                hist = histogramz(rgb2gray(app.I));
                app.App3InputHist.Values1 = hist;
                hist = histogramz(app.O);
                app.App3OutputHist.Values1 = hist;

                % Display Image
                app.O(:,:,2) = app.O(:,:,1);
                app.O(:,:,3) = app.O(:,:,1);
                app.App3OImage.ImageSource = app.O;
            else % selectedButton.Text == "Color"
                app.App3IImage.ImageSource = app.I;
                app.App3InputHist.HistType = HistogramType.Color;
                app.App3OutputHist.HistType = HistogramType.Color;

                % Run function
                app.O = histogramEqualization(app.I(:,:,1));
                app.O(:,:,2) = histogramEqualization(app.I(:,:,2));
                app.O(:,:,3) = histogramEqualization(app.I(:,:,3));
                app.O = cast(app.O, 'uint8');

                % Calc Hist
                app.App3InputHist.Values1 = histogramz(app.I(:,:,1));
                app.App3InputHist.Values2 = histogramz(app.I(:,:,2));
                app.App3InputHist.Values3 = histogramz(app.I(:,:,3));
                app.App3OutputHist.Values1 = histogramz(app.O(:,:,1));
                app.App3OutputHist.Values2 = histogramz(app.O(:,:,2));
                app.App3OutputHist.Values3 = histogramz(app.O(:,:,3));

                % Display Image
                app.App3OImage.ImageSource = app.O;
            end
            app.App3InputHist.refresh();
            app.App3OutputHist.refresh();
            app.App3FileName.Text = app.filename;
        end

        function updateApp4Values(app)
            selectedButton = app.App4SelectMode.SelectedObject;
            if selectedButton.Text == "Grayscale"
                app.App4IImage.ImageSource = app.rgbtogray(app.I);
                app.App4IImageRef.ImageSource = app.rgbtogray(app.R);
                app.App4InputHist.HistType = HistogramType.Grayscale;
                app.App4OutputHist.HistType = HistogramType.Grayscale;

                % Run function
                hist = histogramz(rgb2gray(app.R));
                app.O = histogramSpecification(rgb2gray(app.I), hist);
                app.O = cast(app.O, 'uint8');

                % Calc Hist
                app.App4InputHist.Values1 = hist;
                hist = histogramz(app.O);
                app.App4OutputHist.Values1 = hist;

                % Display Image
                app.O(:,:,2) = app.O(:,:,1);
                app.O(:,:,3) = app.O(:,:,1);
                app.App4OImage.ImageSource = app.O;
            else % selectedButton.Text == "Color"
                app.App4IImage.ImageSource = app.I;
                app.App4IImageRef.ImageSource = app.R;
                app.App4InputHist.HistType = HistogramType.Color;
                app.App4OutputHist.HistType = HistogramType.Color;

                % Run function
                histR = histogramz(app.R(:,:,1));
                histG = histogramz(app.R(:,:,2));
                histB = histogramz(app.R(:,:,3));
                app.O = histogramSpecification(app.I(:,:,1), histR);
                app.O(:,:,2) = histogramSpecification(app.I(:,:,2), histG);
                app.O(:,:,3) = histogramSpecification(app.I(:,:,3), histB);
                app.O = cast(app.O, 'uint8');

                % Calc Hist
                app.App4InputHist.Values1 = histR;
                app.App4InputHist.Values2 = histG;
                app.App4InputHist.Values3 = histB;
                app.App4OutputHist.Values1 = histogramz(app.O(:,:,1));
                app.App4OutputHist.Values2 = histogramz(app.O(:,:,2));
                app.App4OutputHist.Values3 = histogramz(app.O(:,:,3));

                % Display Image
                app.App4OImage.ImageSource = app.O;
            end
            app.App4InputHist.refresh();
            app.App4OutputHist.refresh();
            app.App4FileName.Text = app.filename;
            app.App4FileNameRef.Text = app.ref_filename;
        end
        
        function updateBasedOnTab(app)
            selectedTab = app.TabGroup.SelectedTab;
            
            if selectedTab == app.Tab1
                app.updateApp1Values();
            elseif selectedTab == app.ContrastEnhancementContrastStretchingTab
                app.updateApp2Values();
            elseif selectedTab == app.HistogramEqualizationTab
                app.updateApp3Values();
            elseif selectedTab == app.HistogramSpecificationTab
                app.updateApp4Values();
            end
        end
    end
    

    % Callbacks that handle component events
    methods (Access = private)

        % Selection change function: TabGroup
        function TabGroupSelectionChanged(app, event)
            app.updateBasedOnTab();
        end

        % Button pushed function: App1LoadFileButton
        function App1LoadFileButtonPushed(app, event)
            app.loadImage();
        end

        % Selection changed function: App1SelectMode
        function App1SelectModeSelectionChanged(app, event)
            app.updateApp1Values();
        end

        % Button pushed function: App2LoadFileButton
        function App2LoadFileButtonPushed(app, event)
            app.loadImage();
        end

        % Button pushed function: App2SaveFileButton
        function App2SaveFileButtonPushed(app, event)
            app.saveImage();
        end

        % Selection changed function: App2SelectMode
        function App2SelectModeSelectionChanged(app, event)
            app.updateApp2Values();
        end

        % Value changing function: App2ASlider
        function App2ASliderValueChanging(app, event)
            changingValue = event.Value;
            
            if changingValue >= app.b2
                app.b2 = changingValue;
                app.App2BSlider.Value = changingValue;
            end

            app.a2 = changingValue;
        end

        % Value changed function: App2ASlider
        function App2ASliderValueChanged(app, event)
            app.updateApp2Values();
        end

        % Value changing function: App2BSlider
        function App2BSliderValueChanging(app, event)
            changingValue = event.Value;
            
            if changingValue <= app.a2
                app.a2 = changingValue;
                app.App2ASlider.Value = changingValue;
            end

            app.b2 = changingValue;
        end

        % Value changed function: App2BSlider
        function App2BSliderValueChanged(app, event)
            app.updateApp2Values();
        end

        % Button pushed function: App3LoadFileButton
        function App3LoadFileButtonPushed(app, event)
            app.loadImage();
        end

        % Button pushed function: App3SaveFileButton
        function App3SaveFileButtonPushed(app, event)
            app.saveImage();
        end

        % Selection changed function: App3SelectMode
        function App3SelectModeSelectionChanged(app, event)
            app.updateApp3Values();
        end

        % Button pushed function: App4LoadFileButton
        function App4LoadFileButtonPushed(app, event)
            app.loadImage();
        end

        % Button pushed function: App4LoadFileButtonRef
        function App4LoadFileButtonRefPushed(app, event)
            app.loadRefImage();
        end

        % Button pushed function: App4SaveFileButton
        function App4SaveFileButtonPushed(app, event)
            app.saveImage();
        end

        % Selection changed function: App4SelectMode
        function App4SelectModeSelectionChanged(app, event)
            app.updateApp4Values();
        end
    end

    % Component initialization
    methods (Access = private)

        % Create UIFigure and components
        function createComponents(app)

            % Create UIFigure and hide until all components are created
            app.UIFigure = uifigure('Visible', 'off');
            app.UIFigure.Position = [100 100 960 720];
            app.UIFigure.Name = 'MATLAB App';

            % Create MainGridLayout
            app.MainGridLayout = uigridlayout(app.UIFigure);
            app.MainGridLayout.ColumnWidth = {'1x'};
            app.MainGridLayout.RowHeight = {'1x'};
            app.MainGridLayout.ColumnSpacing = 0;
            app.MainGridLayout.RowSpacing = 0;
            app.MainGridLayout.Padding = [0 0 0 0];

            % Create TabGroup
            app.TabGroup = uitabgroup(app.MainGridLayout);
            app.TabGroup.SelectionChangedFcn = createCallbackFcn(app, @TabGroupSelectionChanged, true);
            app.TabGroup.Layout.Row = 1;
            app.TabGroup.Layout.Column = 1;

            % Create Tab1
            app.Tab1 = uitab(app.TabGroup);
            app.Tab1.Title = 'Histogram';

            % Create Grid1
            app.Grid1 = uigridlayout(app.Tab1);
            app.Grid1.ColumnWidth = {269, '2x'};
            app.Grid1.RowHeight = {'1x'};
            app.Grid1.ColumnSpacing = 0;
            app.Grid1.RowSpacing = 0;
            app.Grid1.Padding = [0 0 0 0];

